description:
Today we see the majority worldview is usually wrong; the world has never been good. Read through REVELATION 16; and study the succession of wrath-filled bowls being poured out on a Christ-rejecting world. Among these cataclysmic events, we see the gathering of Armageddon. Today, hear the words of Jesus Christ on the cross saying, &quot;It is finished.&quot;
Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non- denominational fellowship associating with all who are in the Body of Christ.  
